// Get closest matching competition to query
let obj = fetchSync("http://fca.ickler.cloud/api/v0/competitions?q="+input+"&start="+new Date().toISOString().split("T")[0],{"type": "json"})

if (obj){
    let comp = obj[0]
    let comp_id = comp["url"].split("/")[4]
    let wcaif = fetchSync("http://fca.ickler.cloud/api/v0/competitions/"+comp_id+"/wcif",{"type:"json"})

    print(wcaif["registration_open"])
}else{
    print("No comp found")
}
